"""##Preparing the data
You can’t feed lists of integers into a neural network. You have to turn your lists into
tensors.

to do that we use **Onehot Encoding** manually

basically it is BagOfWord(BOW)
"""

import numpy as np
# def vectorize_sequences(sequences, dimension=88586+1):
def vectorize_sequences(sequences, dimension=25000):
  results = np.zeros((len(sequences), dimension))
  for i, sequence in enumerate(sequences):
    results[i, sequence] = 1.
  return results

x_train = vectorize_sequences(x_train)
x_test = vectorize_sequences(x_test)

# Vectorize the labels also
y_train = np.asarray(y_train).astype('float32')
y_test = np.asarray(y_test).astype('float32')

"""## Model Architecture"""

from tensorflow.keras import models
from tensorflow.keras import layers

model = models.Sequential()

model.add(layers.Dense(16, activation='relu', input_shape=(25000,)))
model.add(layers.Dense(16, activation='relu'))
model.add(layers.Dense(1, activation='sigmoid'))

model.summary()

# (n.of input * no.of output) + no.of bais (1) for each layer
print("Parameters of first layer", 25000 * 16 + 16)
# print("Parameters of first layer", 88586 * 16 + 16)
print("Parameters of Second layer", 16 * 16 + 16)
print("Parameters of Third layer", 16 * 1 + 1)

model.compile(optimizer='rmsprop', loss='binary_crossentropy', metrics=['acc'])

"""###Setting aside a validation set"""

x_val = x_train[:10000]
partial_x_train = x_train[10000:]

y_val = y_train[:10000]
partial_y_train = y_train[10000:]

"""### Training the model

![image.png](data:image/png;base64,)
"""

# Training the model
# history = model.fit(partial_x_train, partial_y_train, batch_size=512, epochs=20, validation_data=(x_val, y_val))
history = model.fit(partial_x_train, partial_y_train, batch_size=512, epochs=6, validation_data=(x_val, y_val))

model.evaluate(x_test, y_test)

"""### Test the model from getting user live review"""

def vectorize_review(review):
  usr_review_index = []
  usr_review_vector = np.zeros((1,25000))
  for word in review.split():
    if word not in usr_review_index:
      usr_review_index.append(word_indexs.get(word))
  for i in usr_review_index:
    usr_review_vector[0, i] = 1.
  return usr_review_vector


res = vectorize_review(input("Enter your Review: "))
predicted_analysis = model.predict(res)
print(predicted_analysis)
print('Positive') if  predicted_analysis> 0.5 else print('Negitive')

model.save('SentimentAnalysis_IMDB_ANN.h5')